# 已经下载的数量
downloadCount = 0
# 下载失败的歌单
failMusicName = [];
# 保存的路径
filePath = '/Users/hc/desktop/music'

def main(jsonString):
	if not os.path.exists(filePath):
		os.makedirs(filePath)

	names, urls = jsonToName(jsonString);
	downloadsDic = dict(zip(names,urls))
	for item in downloadsDic:
		name = item;
		url = downloadsDic[item];
		file_suffix = os.path.splitext(url)[1]
		filename = '{}{}{}{}'.format(filePath,os.sep,name,file_suffix)
		global failMusicName;

		downloadInfo = save_music(url, name);
		musicSize = get_FileSize(filename);
		if musicSize < 1:
			failMusicName.append(name);
		else:
			print("%s---[%s]MB---[%d/%d]" % (downloadInfo, musicSize, downloadCount, len(downloadsDic)))
	print("一共下载%d首歌\n这些歌下载失败:%s" % (downloadCount, failMusicName));

def save_music(url, name):
	global downloadCount
	try:
		file_suffix = os.path.splitext(url)[1]
		filename = '{}{}{}{}'.format(filePath,os.sep,name,file_suffix)
		hhh={'User-Agent': 'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.64 Safari/537.11',
       'Accept': 'text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8',
       'Accept-Charset': 'ISO-8859-1,utf-8;q=0.7,*;q=0.3',
       'Accept-Encoding': 'none',
       'Accept-Language': 'en-US,en;q=0.8',
       'Connection': 'keep-alive'}
		print("\n正在下载%s" % (filename));
		if not os.path.exists(filename):
			request = urllib.request.Request(url,None,hhh) #The assembled request
			response = urllib.request.urlopen(request)
			data = response.read() # The data u need
			with open(filename, 'wb') as f:
				f.write(data)
				downloadCount += 1
				return ("%s下载成功" % (filename))
		else:
			downloadCount += 1
			return print("%s已经存在" % (filename))
	except IOError as e:
		print('下载'+name+'失败',e)
	except Exception as e:
		print('下载'+name+'失败',e)

def jsonToName(data):
	json_str = json.dumps(data)
	data = json.loads(json_str)
	playlist = data['playlist']
	tracks = playlist['tracks']
	names = []
	urls = []
	for item in tracks:
		names.append(item['name'])
		urls.append("http://music.163.com/song/media/outer/url?id=%s.mp3" % (item['id']))
	return names, urls
	print(len(urls))
	print(len(names))

def get_FileSize(filePath):
	fsize = os.path.getsize(filePath)
	fsize = fsize/float(1024*1024)
	return round(fsize,2)

main(jsonString);

